EffectiveDate_Year_E_7.query:
q = load "${App.Datasets.Insurance_Policy3.FullyQualifiedName}";
q = filter q by date('EffectiveDate_Year', 'EffectiveDate_Month', 'EffectiveDate_Day') in ["5 months ago".."current month"];
q = group q by ('EffectiveDate_Year', 'EffectiveDate_Month');
q = foreach q generate 'EffectiveDate_Year' + "~~~" + 'EffectiveDate_Month' as 'EffectiveDate_Year~~~EffectiveDate_Month', avg('MyContactCenterNPS') as 'My Contact Center', avg('NPS_All_Contact_Centers') as 'All Contact Centers';
q = order q by 'EffectiveDate_Year~~~EffectiveDate_Month' asc;
q = limit q 2000;

