lens_10.query:
q = load "${App.Datasets.Insurance_Policy3.FullyQualifiedName}";
q = filter q by date('EffectiveDate_Year', 'EffectiveDate_Month', 'EffectiveDate_Day') in ["5 months ago".."current month"];
q_A = filter q by 'OperationalDrivers' == "Agent Experience";
q_B = filter q by 'OperationalDrivers' == "Agent Comunication";
q_C = filter q by 'OperationalDrivers' == "Employee Satisfaction";
q_D = filter q by 'OperationalDrivers' == "Wait Time";
result = group q_A by ('EffectiveDate_Year', 'EffectiveDate_Month') full, q_B by ('EffectiveDate_Year', 'EffectiveDate_Month') full, q_C by ('EffectiveDate_Year', 'EffectiveDate_Month') full, q_D by ('EffectiveDate_Year', 'EffectiveDate_Month');
result = foreach result generate coalesce(q_A.'EffectiveDate_Year' + "~~~" + q_A.'EffectiveDate_Month', q_B.'EffectiveDate_Year' + "~~~" + q_B.'EffectiveDate_Month', q_C.'EffectiveDate_Year' + "~~~" + q_C.'EffectiveDate_Month', q_D.'EffectiveDate_Year' + "~~~" + q_D.'EffectiveDate_Month') as 'EffectiveDate_Year~~~EffectiveDate_Month', avg(q_A.'Rating') as 'Agent Experience', avg(q_B.'Rating') as 'Agent Comunication', avg(q_C.'Rating') as 'Employee Satisfaction', avg(q_D.'Rating') as 'Wait Time';
result = order result by ('EffectiveDate_Year~~~EffectiveDate_Month' asc);
result = limit result 2000;

